import React from 'react';
import '../App.css';
import lotusflower from '../image/lotusflower.jpg';
import {
  BrowserRouter as Router,
  Link,
} from "react-router-dom";
import Blogpage from './Blogpage';

const Home = () => {
	return (
		<Router>
			<Switch>
			<main className="blog-page">
				<section className="blog-block">
					<Router>
						<Link className="link" to="/Blogpage">
						<Route path="/Blogpage">
						<Blogpage />
						</Route>
							<section className="blog-link">
								<section className="left-column">
									<span className="blog-date">datum</span>
									<span className="blog-cat">kategori</span>
								</section>
								<h1 className="blog-text">
									Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris dictum sem at convallis gravida. Nam efficitur justo lacus, sed ultricies sapien viverra in. Proin tortor lorem, laoreet in turpis sed, condimentum iaculis mi. Fusce leo mauris.
								</h1>
									<img className="blog-image" src={lotusflower} width={300} height={170} alt="flower" />		
							</section>
						</Link>
					</Router>			
				</section>		
			</main>
			</Switch>
			</Router>
	);
};

export default Home;
